import { Box } from '@mui/material';
import React from 'react';
import { useLocation } from 'react-router-dom';

const navItems = [
  {
    label: 'Product Tracking',
    path: '/products'
  },
  {
    label: 'Price Tracking',
    path: '/prices'
  },
  {
    label: 'My Engagement',
    path: '/engagement'
  }
];

export const Header = () => {
  const currentTab = useLocation();

  return (
    <Box
      component={'nav'}
    >
      <p>Header</p>
    </Box>
  );
}
